import React, {useEffect, useState} from 'react';
import './../../App.scss'
import './Get.scss'

const Get = () => {
    let [page, setPage] = useState(1)
    let [users, setUsers] = useState([])


    useEffect(() => {
        fetch(`https://frontend-test-assignment-api.abz.agency/api/v1/users?page=${page}&count=6`)
            .then(response => response.json())
            .then(data => setUsers(users.concat(data.users)))
            .catch(e => console.log(e))
    }, [])

    console.log(users)

    return (
        <section className='get__section'>
            <h1 className='get__title title'> Working with GET request</h1>
            <div>
                {users.map((user) => {
                    return <div className='user__card'>
                        <div className='avatar'><img src={user.photo}/></div>


                    </div>

                })}
            </div>
        </section>
    );
};

export default Get;
